import Projects from './components/Projects.js';
import Footer from './components/Footer.js';

const App = () => {
  return (
      <div className="App">
        <header className="App-header"></header>
          <main>
          <Header></Header>
        <Navbar></Navbar>
          <div className="Title-Container">     {/* TODO: REFACTOR THIS */}
